- input: "TEXT\x1CC00141572\x1C.TEXT\x1C\x1CF3XN\x1CThe State of Oregon allows a $50
    per iindiv tax credit per year for PAC donations.  None of the donations which
    Right to Life/Oregon PAC received in the July 15 Quarterly Report were over $200
    per iindiv & none accumulated to over $200 for the calendar year.  All memo items
    for 5/30/08 for wages, payroll taxes, and employee benefits belong to the transaction
    to Oregon Right to Life for $10,217.11.   Memo item to AT& T Mobility on 5/12/08
    for $89.84 belongs to transaction on same date to Lois Anderson. 05/28/08 transaction
    to Oregon Right to Life for $270.83 does not contain any express advocacy.  The
    05/07/08 receipt from Oregon Right to Life State PAC is for paper that the federal
    pac purchased and the state pac used.  The payment for the paper was on April
    28, 2008 to Paper Plus for $270.30.  This was entered initally as an allocable
    expense. Memo item on 6/16/08 to AT&T Mobility belongs with the transaction to
    Lois Anderson on 6/16/08 for $69.19 for tleephone costs.  The 05/19/08 and the
    06/19/08 $8.00 payments to Oregon Right to Life are the Federal PAC's portion
    of bank charges in April and May 2008 on US Bank Customer Analysis Statements.
    \ SD10.7673 does not contain express advocacy.  All 6/30/08 memo items belong
    to the $8,576.98 check to Oregon Right to Life.  The 6/30/08 check for $270.80
    to Oregon Right to Life contains no  express advocacy."
